import './App.css';
import IngredientSection from './components/IngredientSection';
class App extends Component {

  render() {
    return (
      <div className="App">
        <div className="sector">
            <h1>Ingredient List</h1>
            <IngredientSection />
        </div>
      </div>
    );
  }
}

export default App;
